function Home(){

  function goRooms(){
    const token = localStorage.getItem("userToken");

    if(token){
      window.location = "/rooms";
    }else{
      alert("Please login first");
      window.location = "/login";
    }
  }

  return(
    <div className="text-center p-5 bg-light">
      <h1 className="display-4">Welcome to Luxury Stay</h1>
      <p className="lead">Book your dream room now</p>

      <button className="btn btn-primary btn-lg" onClick={goRooms}>
        View Rooms
      </button>
    </div>
  );
}

export default Home;
